import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [city, setCity] = useState([])

  useEffect(()=>{
    fetch('https://api.weatherbit.io/key=097dd5fffd324ebb875e47ef3fed2fa1')
      .then(data => data.json())
      .then(data => setCity(data.data))
      .catch(error => alert(error))
  },[])

  console.log(city)

  return (
    <div className="App">
      {city.map(item => <h1>{item.city_name}</h1>)}
    </div>
  );
}

export default App;
